import React, { Fragment} from "react"
import Record from "./Record/Record";

import "./record-list.scss";


const RecordList = ({ list , player , controls}) => {

    return (
        <Fragment>
            <ul className="record-list">
                {list && list.map(item => {
                return   <Record  
                            key={item.id} 
                            item={item} 
                            player={player}
                            controls={controls}/>   
                })}
            </ul>
        </Fragment>
    )
}

export default RecordList;
